import React from "react";
import "./Home.css";

const HomePage = () => {
  return (
    <div className="home-wrapper">

      {/* --- First Box --- */}
      <div className="home-box">
        <div className="home-content">
          <h1>The Live Shopping Marketplace</h1>
          <p>Shop, sell, and connect around the things you love.</p>
          <button className="download-btn">Download WhatNew</button>
        </div>
        <div className="home-image">
          <img
            src="https://whatnew.live/assets/images/home-banner.png"
            alt="Live Shopping"
          />
        </div>

        
      </div>

     

    </div>
  );
};

export default HomePage;
